import React, { Component } from 'react';

class CameraView extends Component {
    render() {
        return (
            <div>
                <h2>Camera view</h2>
       
                <p>Duis a turpis sed lacus dapibus elementum sed eu lectus.</p>
            </div>
        );
    }
}

export default CameraView;
